DROP TABLE IF EXISTS `fighters`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `fighters` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `firstname` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `lastname` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `wins` int(11) NOT NULL,
  `loses` int(11) NOT NULL,
  `draws` int(11) NOT NULL,
  `gender` varchar(1) COLLATE utf8_unicode_ci NOT NULL,
  `height_ft` int(11) NOT NULL,
  `height_in` int(11) NOT NULL,
  `weight_lbs` int(11) NOT NULL,
  `weight_class_id` int(10) unsigned NOT NULL,
  `fighter_image_name` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `status` int(11) NOT NULL DEFAULT '0',
  `nationality_id` int(10) unsigned NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `fighters_nationality_id_foreign` (`nationality_id`),
  KEY `fighters_weight_class_id_foreign` (`weight_class_id`),
  CONSTRAINT `fighters_nationality_id_foreign` FOREIGN KEY (`nationality_id`) REFERENCES `nationalities` (`id`),
  CONSTRAINT `fighters_weight_class_id_foreign` FOREIGN KEY (`weight_class_id`) REFERENCES `weight_classes` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=313 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
